import Nav from 'react-bootstrap/Nav';

function Menu() {
  return (
    <Nav
      activeKey="/home"
      onSelect={(selectedKey) => alert(`selected ${selectedKey}`)}
    >
      <Nav.Item>
        <Nav.Link href="/home">Tareas</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link eventKey="link-1">Metas</Nav.Link>
      </Nav.Item>
    </Nav>
  );
}

export default Menu;
